const URL = 'https://api.unsplash.com/search/photos?client_id='

export function allImages(url, body = null) {
    return fetch(URL + process.env.REACT_APP_KEY, {
        method: 'GET',
        body: JSON.string(body),
        headers: { query: url }
    })
    .then(response => response.json());
}
